import logo from './logo.svg';
import './App.css';
import HomePage from './Pages/HomePage/HomePage';
import Navbar from './Pages/Navbar/Navbar';
import Carousal from './Pages/Carousal';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <HomePage/>
      <Carousal/>
    </div>
  );
}

export default App;
